INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'PRIME For Life is an alcohol and drug program for people of all ages. It is designed to gently but powerfully challenge common beliefs and attitudes that directly contribute to high-risk alcohol and drug use. The program goals are to reduce the risk for health problems and impairment problems by:\r\n\r\n \r\nA primary goal of PRIME For Life is prevention of any type of alcohol or drug problem. This includes prevention of health problems such as alcoholism, or impairment problems such as car crashes or fights. Emphasis is on knowing and understanding risks one cannot change and reducing risks one can change.', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'Q: Regarding mental and physical impairment, does alcohol reduce the synaptic response in the brain?\r\nA: In a word, yes, alcohol impairs synaptic response. To be more specific, alcohol affects many neurotransmitter systems, and among them are our two most active ones&mdash;the NMDA glutamate receptors (glutamate is the brain&rsquo;s major natural stimulant) and the GABA receptors (GABA is the brain&rsquo;s major natural sedative). These two balance each other to keep us from being too stimulated or too sedated to function. \r\nAlcohol in GABA receptors makes them function longer (letting more chorine ions into the cells and reducing their electrical activity), which slows the brain even more than GABA itself. At the same time, it inhibits the NMDA receptors, reducing the brain&rsquo;s ability to use glutamate to stimulate itself. Both of these effects have the capacity to slow down virtually all brain functions. Since mental functions are more sensitive to small changes than are physical functions, the mental functions are impaired first and adapt, i.e. develop tolerance, more slowly than the physical. \r\nIn effect, alcohol slows the brain via these mechanisms. As with everything having to do with the brain, it is more complex than this in reality and involves several other brain systems. \r\n9.1. 09CCL,JC\r\n\r\nQ: How do researchers determine certain levels of alcohol use cause health problems? \r\nA: In the studies on the risks associated with alcohol consumption, researchers typically have the participants answer questions about their health, their alcohol use and many other lifestyle choices when the study begins (and sometimes one or more times later). Anywhere from about 4 to 40 years later, they follow up with these people to see how many have developed new illnesses or died, and from what. Statistical analyses, controlling for factors like age, health problems present at the beginning of the study and lifestyle choices are then conducted to see if people who drank certain amounts of alcohol were more or less likely to have developed illnesses or to have died in this period of time compared to abstainers, people who drink infrequently, and/or low-level drinkers. Some of the studies include former drinkers in the comparison "abstainers" group, but others include only lifelong abstainers in this group. Some researchers use infrequent drinkers or low-level drinkers as the comparison group to avoid potential problems that can be caused by having former drinkers in the comparison group, many of which might have stopped drinking because of alcoholism or other serious drinking or health problems.   \r\n\r\nRev10.9.08CCL', '', 'filtered_html'),
('node', 'page', 0, 3, 3, 'und', 0, 'Anonymous (1972). Criteria for the diagnosis of alcoholism by the Criteria Committee, National Council on Alcoholism. American Journal of Psychiatry, 129 , 127-135.\r\n\r\nHilton, M. E. and; Clark, W. B. (1987). Changes in American drinking patterns and problems, 1967-1984. Journal of Studies on Alcohol, 48 , 515-522. Abstract : http://research.bmn.com/medline/search/record?uid=MDLN.88064242&;rendertype=full\r\n\r\nHilton, M. E. (1988). The Demographic Distribution of Drinking Patterns in 1984. Drug and Alcohol Dependence, 22 , 73-104.\r\n\r\nJohnson, F. Gruenewald, P. J., Treno, A. J. and Armstrong-Taff, G. (1998). Drinking over the life course within gender and ethnic groups: A hyperparametric analysis. Journal of Studies on Alcohol, 59 , 568-580. Abstract : http://research.bmn.com/medline/search/record?uid=MDLN.98382236&;rendertype=full\r\n\r\nCadoret, R. J., Yates, W. R., Troughton, E., Woodworth, G. and Stewart, M. A. (1995). Adoption study demonstrating two genetic pathways to drug abuse. Archives of General Psychiatry, 52, 42-52. Abstract: http://research.bmn.com/medline/search/record?uid=MDLN.95110215&rendertype=full\r\n\r\nMcGue, M., Sharma, A. and Benson, P. (1996). Parent and sibling influences on adolescent alcohol use and misuse: Evidence from A U.S. Adoption Cohort. Journal of Studies on Alcohol, 57 , 8-18. Abstract: http://research.bmn.com/medline/search/record?uid=MDLN.96360382&;rendertype=full [u:39c1220ea9]Review:[/u:39c1220ea9] http://www.askpri.org/pri_reviews/Parent_&;_Sibling_Influence_McGue.pdf', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, 'Get the help you need when you really need it! Our counselors are standing by.\r\n\r\nCall: 1-800-555-5555\r\nor for Live Chat Click Here>>>\r\n\r\nContact Support @myPRIME.org', '', 'full_html'),
('node', 'page', 0, 5, 5, 'und', 0, '<h4>Contact Us</h4>\r\n\r\n<form id="contact-form" class="formhelper" action="send_contact.php" method="post">\r\n	<ul>\r\n		<li><p>Your Name*:<br> <input class="required" type="text" name="yourname" /></p></li>\r\n		<li><p>Subject*:<br> <input class="required" type="text" name="subject" /></p></li>\r\n		<li><p>E-mail*:<br> <input class="email-required" type="text" name="email" /></p></li>\r\n		<li><p>Message:<br />\r\n			<textarea name="comments" rows="10" cols="40"></textarea></p>\r\n			<br />\r\n			<p><input type="submit" value="Send it!" rel="facebox"></p>\r\n		</li>\r\n	</ul>\r\n\r\n</form>', '', 'full_html');
