INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' home prime for life is an alcohol and drug program for people of all ages it is designed to gently but powerfully challenge common beliefs and attitudes that directly contribute to highrisk alcohol and drug use the program goals are to reduce the risk for health problems and impairment problems by a primary goal of prime for life is prevention of any type of alcohol or drug problem this includes prevention of health problems such as alcoholism or impairment problems such as car crashes or fights emphasis is on knowing and understanding risks one cannot change and reducing risks one can change  ', 0),
(2, 'node', ' faq q regarding mental and physical impairment does alcohol reduce the synaptic response in the brain a in a word yes alcohol impairs synaptic response to be more specific alcohol affects many neurotransmitter systems and among them are our two most active ones the nmda glutamate receptors glutamate is the brain s major natural stimulant and the gaba receptors gaba is the brain s major natural sedative these two balance each other to keep us from being too stimulated or too sedated to function alcohol in gaba receptors makes them function longer letting more chorine ions into the cells and reducing their electrical activity which slows the brain even more than gaba itself at the same time it inhibits the nmda receptors reducing the brain s ability to use glutamate to stimulate itself both of these effects have the capacity to slow down virtually all brain functions since mental functions are more sensitive to small changes than are physical functions the mental functions are impaired first and adapt ie develop tolerance more slowly than the physical in effect alcohol slows the brain via these mechanisms as with everything having to do with the brain it is more complex than this in reality and involves several other brain systems 91 09ccl jc q how do researchers determine certain levels of alcohol use cause health problems a in the studies on the risks associated with alcohol consumption researchers typically have the participants answer questions about their health their alcohol use and many other lifestyle choices when the study begins and sometimes one or more times later anywhere from about 4 to 40 years later they follow up with these people to see how many have developed new illnesses or died and from what statistical analyses controlling for factors like age health problems present at the beginning of the study and lifestyle choices are then conducted to see if people who drank certain amounts of alcohol were more or less likely to have developed illnesses or to have died in this period of time compared to abstainers people who drink infrequently and or lowlevel drinkers some of the studies include former drinkers in the comparison abstainers group but others include only lifelong abstainers in this group some researchers use infrequent drinkers or lowlevel drinkers as the comparison group to avoid potential problems that can be caused by having former drinkers in the comparison group many of which might have stopped drinking because of alcoholism or other serious drinking or health problems rev10908ccl  ', 0),
(3, 'node', ' research anonymous 1972 criteria for the diagnosis of alcoholism by the criteria committee national council on alcoholism american journal of psychiatry 129 127135 hilton m e and clark w b 1987 changes in american drinking patterns and problems 19671984 journal of studies on alcohol 48 515522 abstract  http researchbmncom medline search record uid mdln88064242 rendert  hilton m e 1988 the demographic distribution of drinking patterns in 1984 drug and alcohol dependence 22 73104 johnson f gruenewald p j treno a j and armstrongtaff g 1998 drinking over the life course within gender and ethnic groups a hyperparametric analysis journal of studies on alcohol 59 568580 abstract  http researchbmncom medline search record uid mdln98382236 rendert  cadoret r j yates w r troughton e woodworth g and stewart m a 1995 adoption study demonstrating two genetic pathways to drug abuse archives of general psychiatry 52 4252 abstract  http researchbmncom medline search record uid mdln95110215 renderty  mcgue m sharma a and benson p 1996 parent and sibling influences on adolescent alcohol use and misuse evidence from a us adoption cohort journal of studies on alcohol 57 818 abstract  http researchbmncom medline search record uid mdln96360382 rendert   u 39c1220ea9 review u 39c1220ea9  http wwwaskpriorg prireviews parent siblinginfluencemcguepdf ', 0),
(4, 'node', ' support get the help you need when you really need it our counselors are standing by call 18005555555 or for live chat click here contact support myprimeorg  ', 0),
(5, 'node', ' contact contact us your name subject email message  ', 0);
